function App() {
  const [email, setEmail] = useState([]);

  useEffect(() => {
    setEmail([
      { id: 1, email: 'teste1' },
      { id: 2, email: 'teste2' },
      { id: 3, email: 'teste3' },
    ])

  }, []) 

  return (
    console.log(Object.keys(email)),
    <div>
      {email.map((e, index) => (
        <small key={ index }>{ e.email1 }</small>
      )) }
    </div>
  )

}

export default App;
